function selectElement(b){document.getElementById(b.id+"-radio").checked=!0;for(var c=document.getElementById("rooms").rows,a=1;a<c.length;a++)c[a].className="";b.className="row-selected"}var selectedRoom;
function selectACPElement(b){document.getElementById(b.id+"-radio").checked=!0;for(var c=document.getElementById("rooms").rows,a=0;a<c.length;a++)c[a].className="";b.className="row-selected";selectedRoom=b.id;c=document.getElementById("room-users");for(a=1;a<c.rows.length;a++)c.rows[a].className=c.rows[a].id===b.id?"":"Invisible"}function redirectToRoom(){null==selectedRoom&&(selectedRoom=document.getElementById("rooms").rows[1].id);location.href=getBaseURL()+"/rooms/"+selectedRoom}
function searchRoom(){for(var b=document.getElementById("rooms").getElementsByTagName("tbody")[0].rows,c=document.getElementById("room-search"),a=0;a<b.length;a++)b[a].className="",""!=c.value&&-1==b[a].cells[0].innerHTML.indexOf(c.value)&&(b[a].className="invisible")}function joinRoom(){for(var b=document.getElementsByName("rooms"),c="",a=0;a<b.length;a++)if(b[a].checked){c=b[a].id;break}b=c.split("-");document.location.href=getBaseURL()+"/rooms/"+b[0]}
function getBaseURL(){var b=document.location.href.split("/");return b[0]+"//"+b[2]};
